Relationship.create([subject_id: (Resource.find_by literal: 'T0010333').id, predicate_id: (Archetype.find_by name: 'scopeNote').id, object_id: (Resource.find_by literal: "يستخدم لوصف الوجهة، المتعلقة بوظيفة الإدارة بشكل عام، التي تحدد وتطبق السياسة النوعية في مؤسسة ما أو في إحدى الشركات التجارية أو الشركات مقدمة الخدمات. ويتضمن هذا المصطلح التخطيط الاستراتيجي، وتوزيع الموارد والنشاطات المعنية بالنوعية مثل التخطيط النوعي والعمليات والتقييم.", language_id: (Language.find_by name: 'ar').id).id])
